type terminationType int

const (
	// Size (in bytes) of a u256
	u256Len = 32
	// Size (in bytes) of a u128
	u128Len = 16
	// Max recursion depth for contracts
	maxCallDepth = 1024
	// Address of the sentinel (metering) contract
	sentinelContractAddress = "0x000000000000000000000000000000000000000a"
	// Append sentinelContractCode to statedb ?
	sentinelContractCode = ""
)

// List of termination reasons
const (
	TerminateFinish = iota
	TerminateRevert
	TerminateSuicide
	TerminateInvalid
)

var (
	meteringCode, _ = hex.DecodeString(sentinelContractCode)
)

// EWASMInterpreter implements the Interpreter interface for ewasm.
type EWASMInterpreter struct {
	vm                 *exec.VM
	evm                *EVM
	StateDB            StateDB
	gasTable           params.GasTable
	contract           *Contract
	returnData         []byte
	terminationType    terminationType
	staticMode         bool
	meteringContract   *Contract
	meteringModule     *wasm.Module
	meteringStartIndex int64
}

func (in *EWASMInterpreter) IsReadOnly() bool {
	panic("implement me")
}

func (in *EWASMInterpreter) SetReadOnly(bool) {
	panic("implement me")
}

// NewEWASMInterpreter creates a new wagon-based ewasm interpreter. It
// currently takes a *vm.EVM pointer as a proxy to the client's internal
// state; this will be fixed in subsequent updates.
func NewEWASMInterpreter(evm *EVM) Interpreter {
	var (
		inter = &EWASMInterpreter{
			StateDB:  evm.StateDB,
			evm:      evm,
			gasTable: evm.chainConfig.GasTable(evm.BlockNumber),
		}
	)
	return inter
}

// Run loops and evaluates the contract's code with the given input data and returns
// the return byte-slice and an error if one occurred.
func (in *EWASMInterpreter) Run(contract *Contract, input []byte, ro bool) ([]byte, error) {
	//st := time.Now()
	//defer log.Info("<<EWASMInterpreter.Run>> ", "caller", contract.Caller().Hex(), "addr", contract.Address().Hex(), "code.len", len(contract.Code), "time", time.Since(st))
	// Increment the call depth which is restricted to 1024
	in.evm.depth++
	defer func() { in.evm.depth-- }()

	in.contract = contract
	in.contract.Input = input
	if len(contract.Code) < 65 {
		return nil, errors.New("wasm_code_error")
	}

	module, err := wasm.ReadModule(bytes.NewReader(contract.Code[:len(contract.Code)-64]), WrappedModuleResolver(in))
	if err != nil {
		in.terminationType = TerminateInvalid
		return nil, fmt.Errorf("Error decoding module at address %s: %v", contract.Address().Hex(), err)
	}
	vm, err := exec.NewVM(module)
	if err != nil {
		in.terminationType = TerminateInvalid
		panic(err)
		return nil, fmt.Errorf("could not create the vm: %v", err)
	}
	vm.RecoverPanic = true
	in.vm = vm

	mainIndex, err := validateModule(module)
	if err != nil {
		in.terminationType = TerminateInvalid
		panic(err)
		return nil, err
	}

	// Check input and output types
	sig := module.FunctionIndexSpace[mainIndex].Sig

	// 此处确保 main 函数必须是 void main() {} 形式的
	if len(sig.ParamTypes) == 0 && len(sig.ReturnTypes) == 0 {
		_, err := vm.ExecCode(int64(mainIndex))
		if err != nil && err != errExecutionReverted {
			log.Error("EWASM-ExecCode->", "err", err)
			in.terminationType = TerminateInvalid
		}

		if in.StateDB.HasSuicided(contract.Address()) {
			in.StateDB.AddRefund(params.SuicideRefundGas)
			err = nil
		}
		// 在执行 eei 函数时没有显示的返回值，所以只返回了一个错误类型，如果 err==nil 那么这个条件成立时就是 out of gas
		if in.terminationType == TerminateInvalid {
			return nil, errors.New("wasm_exec_fail : may be out of gas")
		}
		return in.returnData, err
	}
	log.Error("<<EWASMInterpreter.Run>> error : no export function")

	in.terminationType = TerminateInvalid
	return nil, errors.New("Could not find a suitable 'main' function in that contract")
}

// CanRun checks the binary for a WASM header and accepts the binary blob
// if it matches.
func (in *EWASMInterpreter) CanRun(file []byte) bool {
	return IsWASM(file)
}

